import React from "react";
import { FiUser } from "react-icons/fi";
const Header = () => {
  return (
    <div className="  top-1 h-2    flex justify-between">
      <div className="font-bold flex items-center ">
        <p className="  w-20 ">MyPass</p>
        <a>ページ内検索</a>
      </div>
      <div>
        <FiUser />
      </div>
    </div>
  );
};

export default Header;
